import cv2
import numpy as np
import base64
from io import BytesIO
from PIL import Image
import pyautogui
import time
import pygetwindow as gw

# Base64 encoded string of the Tetris grid template
base64_string = """

"""

# Function to load template image from Base64
def load_template_from_base64():
    image_data = base64.b64decode(base64_string)
    image = Image.open(BytesIO(image_data))
    return cv2.cvtColor(np.array(image), cv2.COLOR_RGB2BGR)

# Function to find the Tetris game window
def find_game_window(window_title="Tetris Effect: Connected"):
    for window in gw.getWindowsWithTitle(window_title):
        if window_title.lower() in window.title.lower():
            return window
    return None

# Function to capture a specific region of the screen
def capture_screen(region=None):
    screenshot = pyautogui.screenshot(region=region)
    frame = np.array(screenshot)
    return cv2.cvtColor(frame, cv2.COLOR_RGB2BGR)

# Load the template image
try:
    grid_template = load_template_from_base64()
    print("Template loaded successfully!")
except Exception as e:
    print(f"Failed to load template: {e}")
    exit()

# Main Script
print("Looking for the Tetris Effect: Connected game window...")
time.sleep(3)

try:
    while True:
        # Continuously check for the game window
        game_window = find_game_window("Tetris Effect: Connected")
        if game_window:
            # Update the game region dynamically
            GAME_REGION = (game_window.left, game_window.top, game_window.width, game_window.height)
            screen = capture_screen(region=GAME_REGION)

            # Test: Show the captured region
            cv2.imshow("Game Detection", screen)
        else:
            print("Game window not found. Make sure the game is running and visible.")
            time.sleep(1)  # Wait a bit before retrying

        if cv2.waitKey(1) & 0xFF == ord('q'):
            print("Exiting detection...")
            break

except KeyboardInterrupt:
    print("Interrupted. Closing detection.")

cv2.destroyAllWindows()
